import React, {useState} from 'react'
import './Counter-Style.css';


const Counter = () => {

    const [count, setCount] = useState(0);


    return (
        <div className='counter' onClick={
            () => setCount(count + 1)
        }>
            <h1>{count}</h1>
        </div>
    )
}

export default Counter
